Então, como usar estes comandos em conjunto? O fluxo normal é git add => git status => git commit. Eis um exemplo. Primeiro criaremos o projeto: mkdir projeto
cd projeto
git init Agora, introduziremos um arquivo main.c: int main()
{ return 0;
} E vamos tornar nosso novo arquivo staged : git add main.c Vamos olhar o que estamos introduzindo: git status saída do git status Pronto! Podemos fazer o nosso primeiro commit. git commit -m 'adicionada a função principal'
